import XCTest
import JSONReader

class JSONTokenizerTest: XCTestCase {

    var tk: JSONTokenizer!
    
    override func setUp() {
        super.setUp()
        tk = JSONTokenizer(JSONString: "")
        println("\n----------------------------")
    }
    
    override func tearDown() {
        // Put teardown code here. This method is called after the invocation of each test method in the class.
        println("----------------------------\n")
        super.tearDown()
    }

    func testExample() {
        // This is an example of a functional test case.
        tk = JSONTokenizer(JSONString: "  {   \"hello\\\"\\\\\\t\\r\\b\\f\\n\":123}")
        XCTAssertEqual(Token.leftCurlyBrace , tk.peek()! , "Not Equal")
        XCTAssertEqual(Token.leftCurlyBrace , tk.next()! , "Not Equal")
        XCTAssertNotEqual(Token.leftCurlyBrace, tk.peek()!, "They are equal")
        XCTAssertEqual(Token.stringToken("hello\"\\\t\r\u{8}\u{12}\n") , tk.next()! , "Not Equal")
        XCTAssertEqual(Token.colon, tk.next()! , "Not Equal")
        XCTAssertEqual(Token.digits("123"), tk.next()! , "Not Equal")
        XCTAssertEqual(Token.rightCurlyBrace, tk.next()! , "Not Equal")



    }

    func testEmoji(){
        tk = JSONTokenizer(JSONString: "{ \"emoji\" : \"\\ud83d\\ude04\" }")
        XCTAssertEqual(Token.leftCurlyBrace , tk.next()! , "Not Equal")
        XCTAssertEqual(Token.stringToken("emoji") , tk.next()! , "Not Equal")
        XCTAssertEqual(Token.colon , tk.next()! , "Not Equal")
        XCTAssertEqual(Token.stringToken("ðŸ˜„") , tk.next()! , "Not Equal")
        XCTAssertEqual(Token.rightCurlyBrace , tk.next()! , "Not Equal")
    }
    
    func testArrays(){
        tk = JSONTokenizer(JSONString: "{ \"emoji\" : [\"hi\"  , \n \"hi\"] }   ")
        XCTAssertEqual(Token.leftCurlyBrace , tk.next()! , "Not Equal")
        XCTAssertEqual(Token.stringToken("emoji") , tk.next()! , "Not Equal")
        XCTAssertEqual(Token.colon , tk.next()! , "Not Equal")
        XCTAssertEqual(Token.leftSquareBracket, tk.next()!, "")
        XCTAssertEqual(Token.stringToken("hi"), tk.next()!, "")
        XCTAssertEqual(Token.comma, tk.next()!, "")
        XCTAssertEqual(Token.stringToken("hi"), tk.next()!, "")
        XCTAssertEqual(Token.rightSquareBracket, tk.next()!, "")
        XCTAssertEqual(Token.rightCurlyBrace, tk.next()!, "")
        
        tk = JSONTokenizer(JSONString: "[]")
        println(tk.peek()!)
        XCTAssertEqual(Token.leftSquareBracket, tk.next()!)
        println(tk.peek()!)
        XCTAssertEqual(Token.rightSquareBracket, tk.next()!)
        

    }
    
    func testMultipleMembers(){
        tk = JSONTokenizer(JSONString: "{ \"emoji\" : [\"hi\"  , \n \"hi\"], \"hi\":\"hi23\" }   ")
        XCTAssertEqual(Token.leftCurlyBrace , tk.next()! , "Not Equal")
        XCTAssertEqual(Token.stringToken("emoji") , tk.next()! , "Not Equal")
        XCTAssertEqual(Token.colon , tk.next()! , "Not Equal")
        XCTAssertEqual(Token.leftSquareBracket, tk.next()!, "")
        XCTAssertEqual(Token.stringToken("hi"), tk.next()!, "")
        XCTAssertEqual(Token.comma, tk.next()!, "")
        XCTAssertEqual(Token.stringToken("hi"), tk.next()!, "")
        XCTAssertEqual(Token.rightSquareBracket, tk.next()!, "")
        XCTAssertEqual(Token.comma, tk.next()!, "")
        XCTAssertEqual(Token.stringToken("hi") , tk.next()! , "Not Equal")
        XCTAssertEqual(Token.colon , tk.next()! , "Not Equal")
        XCTAssertEqual(Token.stringToken("hi23"), tk.next()!, "")
        XCTAssertEqual(Token.rightCurlyBrace, tk.next()!, "")
    }

    func testNumbers(){
        tk = JSONTokenizer(JSONString: "{\"elem0\":123, \"\":123.23e98, \"dasd\":1873.23e-98, \"elem12.23\":1873.23e+98 }")
        XCTAssertEqual(Token.leftCurlyBrace , tk.next()! , "Not Equal")
        XCTAssertEqual(Token.stringToken("elem0") , tk.next()! , "Not Equal")
        XCTAssertEqual(Token.colon, tk.next()!, "")
        XCTAssertEqual(Token.digits("123"), tk.next()!, "")
        XCTAssertEqual(Token.comma, tk.next()!, "")
        XCTAssertEqual(Token.stringToken("") , tk.next()! , "Not Equal")
        XCTAssertEqual(Token.colon, tk.next()!, "")
        XCTAssertEqual(Token.digits("123"), tk.next()!, "")
        XCTAssertEqual(Token.dot, tk.next()!, "")
        XCTAssertEqual(Token.digits("23"), tk.next()!, "")
        XCTAssertEqual(Token.ePlus, tk.next()!, "")
        XCTAssertEqual(Token.digits("98"), tk.next()!, "")
        XCTAssertEqual(Token.comma, tk.next()!, "")
        XCTAssertEqual(Token.stringToken("dasd") , tk.next()! , "Not Equal")
        XCTAssertEqual(Token.colon, tk.next()!, "")
        XCTAssertEqual(Token.digits("1873"), tk.next()!, "")
        XCTAssertEqual(Token.dot, tk.next()!, "")
        XCTAssertEqual(Token.digits("23"), tk.next()!, "")
        XCTAssertEqual(Token.eMinus, tk.next()!, "")
        XCTAssertEqual(Token.digits("98"), tk.next()!, "")
        XCTAssertEqual(Token.comma, tk.next()!, "")
        XCTAssertEqual(Token.stringToken("elem12.23") , tk.next()! , "Not Equal")
        XCTAssertEqual(Token.colon, tk.next()!, "")
        XCTAssertEqual(Token.digits("1873"), tk.next()!, "")
        XCTAssertEqual(Token.dot, tk.next()!, "")
        XCTAssertEqual(Token.digits("23"), tk.next()!, "")
        XCTAssertEqual(Token.ePlus, tk.next()!, "")
        XCTAssertEqual(Token.digits("98"), tk.next()!, "")
        XCTAssertEqual(Token.rightCurlyBrace, tk.next()!, "")
        
        tk = JSONTokenizer(JSONString: "2.0e4")
        XCTAssertEqual(Token.digits("2"), tk.next()!, "")
        XCTAssertEqual(Token.dot, tk.next()!, "")
        XCTAssertEqual(Token.digits("0"), tk.next()!, "")
        XCTAssertEqual(Token.ePlus, tk.next()!, "")
        XCTAssertEqual(Token.digits("4"), tk.next()!, "")

        
    }
    
    func testTrueFalseNull(){
        tk = JSONTokenizer(JSONString: "{\"elem0\":true,\"elem1\":false,\"elem2\":null}")
        XCTAssertEqual(Token.leftCurlyBrace , tk.next()! , "Not Equal")
        XCTAssertEqual(Token.stringToken("elem0") , tk.next()! , "Not Equal")
        XCTAssertEqual(Token.colon, tk.next()!, "")
        XCTAssertEqual(Token.trueValue, tk.next()!, "")
        XCTAssertEqual(Token.comma, tk.next()!, "")
        XCTAssertEqual(Token.stringToken("elem1") , tk.next()! , "Not Equal")
        XCTAssertEqual(Token.colon, tk.next()!, "")
        XCTAssertEqual(Token.falseValue, tk.next()!, "")
        XCTAssertEqual(Token.comma, tk.next()!, "")
        XCTAssertEqual(Token.stringToken("elem2") , tk.next()! , "Not Equal")
        XCTAssertEqual(Token.colon, tk.next()!, "")
        XCTAssertEqual(Token.null, tk.next()!, "")
        XCTAssertEqual(Token.rightCurlyBrace, tk.next()!, "")
    }

    
